import React from "react";
import "./Loader.css";

function Loader() {
  return (
    <section className="loading">
      {/* <div className="loading-2 loading-2--full-height"></div> */}

      <div class="blocks">
        <div class="block orange"></div>
        <div class="block blue"></div>
      </div>
    </section>
  );
}

export default Loader;
